import Grid from '@mui/material/Grid2';


import Banner from '../banner/banner';
import Categories from './Categories';

const Home = () => {
    return (
        <>
            <Banner />
            <Grid container spacing={1}>
                <Grid item md={2} xs={12} sm={2}>
                    <Categories />
                </Grid>
                <Grid container item xs={12} sm={10} md={10}>
                    posts
                </Grid>
            </Grid>
        </>
    )
}

export default Home;
